En Santa María de Punilla se celebra una nueva edición del Festival de la Avicultura. El Predio El Paseo, un espacio a cielo abierto enmarcado en las Sierras Chicas de Córdoba, es el escenario donde grandes artistas despliegan sus talentos. .

